import React, { Component } from 'react'
import styled from 'styled-components'



const Container = styled.div`
width:100%;
justify-content:center;
align-items:center;
margin:0 auto;
height:100%;
background:var(--secondary-color);
z-index:1;
position:relative;



`
const ContainerInner = styled.div`
max-width:70%;

color:white;
line-height:20px;
display:flex;
margin:0 auto;

`

const Heading = styled.h2`
color: var(--secondary-color);
margin: 0px;
text-align: center;
`


const Box = styled.div`
background:var(--Section-color);
`

const List= styled.ul`
    color:aliceblue;
    line-height:20px;
    width:100%;

`

const Item= styled.li`
    color:aliceblue;
    list-style:none;
    width:80%;
    padding-left:10px;
  `
  const Block= styled.div`
   width:100%;

`
  const Des= styled.h2`
  margin:0 auto;
  text-align:center;
`

class Events extends Component {

  render() {



    return (


        <Container id="Hobbies">
           <Box>
          <Heading className="headings">Events</Heading>
          <ContainerInner>
          <List>
            <Item>-&nbsp;&nbsp;Birthday Parties </Item>
            &nbsp;
            <Item>-&nbsp;&nbsp;Engagement Parties / Surprises </Item>
            &nbsp;
            <Item>-&nbsp;&nbsp;Gala Dinners  </Item>



          </List>
          <List>

            <Item>-&nbsp;&nbsp;Bridal Parties </Item>
            &nbsp;
            <Item>-&nbsp;&nbsp;Graduation Party </Item>
            &nbsp;
            <Item>-&nbsp;&nbsp;Conferencing </Item>

          </List>
          <List>
            <Item>-&nbsp;&nbsp;Baby Showers / Welcoming</Item>
            &nbsp;
            <Item>-&nbsp;&nbsp;Gender Reveals </Item>
            &nbsp;
            <Item>-&nbsp;&nbsp;Launch Party etc. </Item>
          </List>

          </ContainerInner>
          <Block>
          <Des>Please request a quote for these services</Des>
          </Block>
          </Box>

        </Container>

    );
  }
}
export default Events;
